Het rendier Elliott raakt bevriend met de door mensen opgevoede grizzlybeer Boog, wanneer beide alleen komen te staan tijdens 
het jachtseizoen. Intussen probeert boswachter Beth, die de beer heeft opgevoed, haar vriend terug te vinden.
